import React from "react";
import '../../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../../../assets/css/project/projects_common_style.css';

const Project = () =>{
    return(
        <div style={{color:"#fff"}}>
          
        <div className="project_head">
        <div className="project_inline">
            <div className="project_info">
             <span >Project Info</span>
            </div>
            <div className="project_more_info col-lg-12 col-md-12 col-sm-a2">
                <span className="col-lg-3"><b>Date:</b>07.21.2021</span>
                <span className="col-lg-3"><b>Category:</b>Web Development</span>
                <span className="col-lg-2"><b>Client</b> Biba Trading</span>
            </div>
        </div>
        </div>
        </div>
    )
}
export default Project;
